CREATE DATABASE IF NOT EXISTS `matcha` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;
USE `matcha`;



CREATE TABLE IF NOT EXISTS `profiles` (
    `id_profile` int(11) NOT NULL  AUTO_INCREMENT,
	`username` varchar(50) NOT NULL,
	`name` varchar(50) NOT NULL,
	`surname` varchar(50) NOT NULL,
	`city` varchar(50) NOT NULL,
  	`lat` FLOAT( 10, 6 ) NOT NULL ,
  	`lon` FLOAT( 10, 6 ) NOT NULL ,
	`age` varchar(50) NOT NULL,
	`gender` varchar(50) NOT NULL,
	`preferences` varchar(50) NOT NULL,
	`bio` varchar(500) NOT NULL,
	`tags` varchar(50) NOT NULL,
    `img0` varchar(500) NOT NULL,
    `img1` varchar(500) NOT NULL,
    `img2` varchar(500) NOT NULL,
    `img3` varchar(500) NOT NULL,
	`img4` varchar(500) NOT NULL,
	`fram` int(11) NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
	`checker` int(11) NOT NULL DEFAULT 0,

	PRIMARY KEY (`id_profile`)

	

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `accounts` (
	`id` int(11) NOT NULL AUTO_INCREMENT,
  	`username` varchar(50) NOT NULL,
  	`email` varchar(100) NOT NULL,
	`password` varchar(255) NOT NULL,
  	`token` varchar(255) NOT NULL,
	`confirm` int(11) NOT NULL DEFAULT 0,
	

	FOREIGN KEY (id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE
	
    
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `likes` (
	`id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `id_src` int(11) NOT NULL,
	`id_dst` int(11) NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (id_src)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `chat` (
    `id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`user1_id` int(11) NOT NULL,
	`user2_id` int(11) NOT NULL,

	FOREIGN KEY (user1_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `messages` (
    `id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`user_id` int(11) NOT NULL,
	`res_id` int(11) NOT NULL,
	`sender_username` varchar(50) NOT NULL,
	`recipient_username` varchar(50) NOT NULL,
	`text` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (user_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE,

	FOREIGN KEY (res_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE


)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `visits` (
    `id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`visiter_id` int(11) NOT NULL,
	`visited_id` int(11) NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (visiter_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE
	

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `reports` (
    `id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`user_id` int(11) NOT NULL,
	`reported_id` int(11) NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (user_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `block` (
	`id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`user_id` int(11) NOT NULL,
	`blocked_id` int(11) NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (user_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;



CREATE TABLE IF NOT EXISTS `notf` (
	`id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
	`user_id` int(11) NOT NULL,
	`message` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
	`link` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
	`timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,

	FOREIGN KEY (user_id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE

)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `n` (
	`id` int(11) NOT NULL ,
	`username` varchar(50) NOT NULL,
	`num` int(11) NOT NULL,
	`log` int(11) NOT NULL,

	FOREIGN KEY (id)
        REFERENCES profiles (id_profile)
        ON DELETE CASCADE


)ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;


